import { StyleSheet, Text, View } from 'react-native'
import React, { useState } from 'react'

const CountryDetails = ({ route, navigation }) => {
  const {countriesList}=route.params;
const [natives, setNatives] = useState('')
for(const nativeName in countriesList.name.nativeName){
  setNatives(nativeName)
}
  return (
    <View style={styles.container}>
      <Text>{countriesList.name.common}</Text>
      <Text>{countriesList.capital}</Text>
      <Text>{countriesList.region}</Text>
      <Text>{countriesList.timezones}</Text>
      <Text>{countriesList.population}</Text>
      <Text>{countriesList.nativeName}</Text>
    </View>
  )
}

export default CountryDetails

const styles = StyleSheet.create({
    container:{backgroundColor:'#D6E4E5',padding:10,marginBottom:10,borderRadius:10,marginVertical:5}
})
